import { GlobalProvider } from "./context/GlobalState.jsx";

import "./App.css";

function App() {
  return (
    <GlobalProvider>
        <Header />
        <div className="container">
          <Balance />
          <IncomeExpenses />
          <Transactionlist />
          <Addtransaction />
        </div>
    </GlobalProvider>
  );
}

export default App;
